import React, {Fragment} from 'react'

let Footer = () => {
    return (
        <Fragment>
         <footer className='bg-dark text-white text-center '>
            <div className="container">
                <div className="row">
                    <div className="col">
                        <h3>Copyright & copy;mykart.com </h3>
                        <p>All rights Reserved</p>

                    </div>
                </div>
            </div>
         </footer>
        </Fragment>
    );
};

export default Footer;
